import { Component,OnInit } from '@angular/core';
import {HeadCardModel} from "../model/head-card.modele";

@Component({
  selector: 'app-title-page',
  templateUrl: './title-page.component.html',
  styleUrls: ['./title-page.component.scss']
})
export class TitlePageComponent implements OnInit{
  card1!:HeadCardModel;
  card2!:HeadCardModel;
  card3!:HeadCardModel;
  ngOnInit() {
    this.card1=new HeadCardModel("","Card1");
    this.card2=new HeadCardModel("","Card2");
    this.card3=new HeadCardModel("","Card3");

  }
}
<div class="container text-center">
  <div class="row">
    <div class="col mt-4">
      <app-head-card [card]="card1"></app-head-card>
    </div>
    <div class="col mt-4">
      <app-head-card [card]="card2"></app-head-card>
    </div>
    <div class="col mt-4">
      <app-head-card [card]="card3"></app-head-card>
    </div>
  </div>
</div>
